(181, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến [i]lt[/i] là gì?\r\n[pre]\r\nlt:=1;\r\nfor i:= 1 to a do lt:=lt*b;\r\n[/pre]', 1, '2014-12-07 11:04:09'),
